/* ------ Qwant - Logo Original ------ */
/* -------  by Hawk63 [SCNet]   ------ */


@-moz-document domain("qwant.com")
{

/* Texte de promo dans header */
.header__text {
    display: none !important
}

/* Logo */

.home__logo {
    background: none !important;
}

.home__logo__container {
    display: block !important;
    height: 275px !important;
    background: url('data:image/png;base64,') no-repeat center top !important;
}

.home__logo__container a {
    display: block !important;
    height: 100%;
    opacity: 0;
}

.home__logo__container a:hover {
    opacity: 1;
    transition: opacity .5s ease-in .5s;
}

.trends--general__info__text--brand--custom {
        display: none;
}

/* Slogan sous logo */
.home__baseline {
    padding-top: 25px;
}

/* Promo sous logo */
.snippet {
    display: none !important;
}

/* Demandes d'installation d'extension */
.header__add-qwant {
    display: none;
}
.home__snippet__extension:not(.header__add-qwant) {
    display: none;
}

/* Demandes de partages */
.header__share-qwant {
    display: none !important;
}
}
